async function fetchDataFromApi(apiUrl, apiKey) {
    try {
      const response = await fetch(apiUrl);
      const data = await response.json();
      return data; 
    } catch (error) {
      console.error("Error fetching data:", error);
      throw error; 
    }
  }

  export default fetchDataFromApi;
